import React from "react";
import "./Sidebar.css";

export default function Sidebar() {
  const menuItems = [
    { icon: "fa-home", label: "الرئيسية" },
    { icon: "fa-flag", label: "الواقع الفلسطيني" },
    { icon: "fa-landmark", label: "مشاريع التراث" },
    { icon: "fa-cog", label: "الإعدادات" },
  ];

  return (
    <aside className="sidebar">
      <nav>
        {menuItems.map((item, idx) => (
          <a key={idx} href="#" className="sidebar-item">
            <i className={`fas ${item.icon}`}></i>
            <span>{item.label}</span>
          </a>
        ))}
      </nav>
    </aside>
  );
}
